D%D0%B8%D0%B5_%D0%B2_%D0%90%D0%BB%D0%B5%D0%BF%D0%BF%D0%BE\" title=\"\u0417\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u0435 \u0432 \u0410\u043b\u0435\u043f\u043f\u043e\">\u0437\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u0435 \u0432 \u0410\u043b\u0435\u043f\u043f\u043e<\/a>, \u0436\u0435\u0440\u0442\u0432\u0430\u043c\u0438 \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0441\u0442\u0430\u043b\u0438 230 \u0442\u044b\u0441. \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1521_%D0%B3%D0%BE%D0%B4\" title=\"1521 \u0433\u043e\u0434\">1521<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BF%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u041f\u0430\u043f\u0441\u0442\u0432\u043e\">\u0440\u0438\u043c\u0441\u043a\u0438\u0439 \u043f\u0430\u043f\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%B2_X_(%D0%BF%D0%B0%D0%BF%D0%B0_%D1%80%D0%B8%D0%BC%D1%81%D0%BA%D0%B8%D0%B9)\" class=\"mw-redirect\" title=\"\u041b\u0435\u0432 X (\u043f\u0430\u043f\u0430 \u0440\u0438\u043c\u0441\u043a\u0438\u0439)\">\u041b\u0435\u0432 X<\/a> (<span lang=\"la\" style=\"font-style: italic\" xml:lang=\"la\">Leo PP. X<\/span>) \u043f\u0440\u0438\u0441\u0432\u043e\u0438\u043b \u043a\u043e\u0440\u043e\u043b\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D1%80%D0%B8%D1%85_VIII\" title=\"\u0413\u0435\u043d\u0440\u0438\u0445 VIII\">\u0413\u0435\u043d\u0440\u0438\u0445\u0443 VIII<\/a> (<span lang=\"en\" style=\"font-style: italic\" xml:lang=\"en\">Henry VIII of England<\/span>) <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B8%D1%82%D1%83%D0%BB\" title=\"\u0422\u0438\u0442\u0443\u043b\">\u0442\u0438\u0442\u0443\u043b<\/a> \u00ab\u0417\u0430\u0449\u0438\u0442\u043d\u0438\u043a \u0432\u0435\u0440\u044b\u00bb (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D1%82%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"\u041b\u0430\u0442\u0438\u043d\u0441\u043a\u0438\u0439 \u044f\u0437\u044b\u043a\">\u043b\u0430\u0442.<\/a>&#160;<i><span lang=\"la\" xml:lang=\"la\">FIDEI DEFENSOR<\/span><\/i>) \u0437\u0430 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BC%D1%84%D0%BB%D0%B5%D1%82\" title=\"\u041f\u0430\u043c\u0444\u043b\u0435\u0442\">\u043f\u0430\u043c\u0444\u043b\u0435\u0442<\/a>, \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u043d\u044b\u0439 \u043f\u0440\u043e\u0442\u0438\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8E%D1%82%D0%B5%D1%80,_%D0%9C%D0%B0%D1%80%D1%82%D0%B8%D0%BD\" title=\"\u041b\u044e\u0442\u0435\u0440, \u041c\u0430\u0440\u0442\u0438\u043d\">\u041c\u0430\u0440\u0442\u0438\u043d\u0430 \u041b\u044e\u0442\u0435\u0440\u0430<\/a> (<span lang=\"de\" style=\"font-style: italic\" xml:lang=\"de\">Martin Luther<\/span>). \u041a\u043e\u0433\u0434\u0430 \u0436\u0435 \u043a\u043e\u0440\u043e\u043b\u044c \u0438\u0437-\u0437\u0430 \u0431\u0440\u0430\u0447\u043d\u044b\u0445 \u043f\u0440\u043e\u0431\u043b\u0435\u043c \u043f\u043e\u0440\u0432\u0430\u043b \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%82%D0%B8%D0%BA%D0%B0%D0%BD\" title=\"\u0412\u0430\u0442\u0438\u043a\u0430\u043d\">\u0412\u0430\u0442\u0438\u043a\u0430\u043d\u043e\u043c<\/a>, \u0434\u0440\u0443\u0433\u043e\u0439 \u043f\u0430\u043f\u0430&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%B2%D0%B5%D0%BB_III_(%D0%BF%D0%B0%D0%BF%D0%B0_%D1%80%D0%B8%D0%BC%D1%81%D0%BA%D0%B8%D0%B9)\" class=\"mw-redirect\" title=\"\u041f\u0430\u0432\u0435\u043b III (\u043f\u0430\u043f\u0430 \u0440\u0438\u043c\u0441\u043a\u0438\u0439)\">\u041f\u0430\u0432\u0435\u043b III<\/a> (<span lang=\"la\" style=\"font-style: italic\" xml:lang=\"la\">Paulus PP III<\/span>)&#160;\u2014 \u043b\u0438\u0448\u0438\u043b \u043a\u043e\u0440\u043e\u043b\u044f \u043f\u043e\u0447\u0451\u0442\u043d\u043e\u0433\u043e \u0442\u0438\u0442\u0443\u043b\u0430, \u043d\u043e \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%BB%D0%B0%D0%BC%D0%B5%D0%BD%D1%82\" title=\"\u041f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\">\u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442<\/a> \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u043b \u043f\u043e\u043d\u0440\u0430\u0432\u0438\u0432\u0448\u0438\u0439\u0441\u044f \u043a\u043e\u0440\u043e\u043b\u044e \u0442\u0438\u0442\u0443\u043b, \u0438 \u043e\u043d \u0434\u043e \u0441\u0438\u0445 \u043f\u043e\u0440 \u0444\u0438\u0433\u0443\u0440\u0438\u0440\u0443\u0435\u0442 \u0432 \u043f\u043e\u043b\u043d\u043e\u043c \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u043e\u043c \u0442\u0438\u0442\u0443\u043b\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1658_%D0%B3%D0%BE%D0%B4\" title=\"1658 \u0433\u043e\u0434\">1658<\/a>&#160;\u2014 \u0440\u0443\u0441\u0441\u043a\u043e\u0435 \u0432\u043e\u0439\u0441\u043a\u043e \u043f\u043e\u0431\u0435\u0436\u0434\u0430\u0435\u0442 \u043b\u0438\u0442\u043e\u0432\u0446\u0435\u0432 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D0%BE%D0%B4_%D0%92%D0%B5%D1%80%D0%BA%D0%B0%D0%BC%D0%B8\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u043e\u0434 \u0412\u0435\u0440\u043a\u0430\u043c\u0438\">\u0431\u0438\u0442\u0432\u0435 \u043f\u043e\u0434 \u0412\u0435\u0440\u043a\u0430\u043c\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1783_%D0%B3%D0%BE%D0%B4\" title=\"1783 \u0433\u043e\u0434\">1783<\/a>&#160;\u2014 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BA%D0%B0%D0%B4%D0%B5%D0%BC%D0%B8%D1%8F_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F\" title=\"\u0410\u043a\u0430\u0434\u0435\u043c\u0438\u044f \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u044f<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82\" title=\"\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\">\u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u043e\u043c<\/a> \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u0438 \u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BD%D1%8F%D0%B7%D1%8C\" title=\"\u041a\u043d\u044f\u0437\u044c\">\u043a\u043d\u044f\u0433\u0438\u043d\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D1%88%D0%BA%D0%BE%D0%B2%D0%B0,_%D0%95%D0%BA%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D0%B0_%D0%A0%D0%BE%D0%BC%D0%B0%D0%BD%D0%BE%D0%B2%D0%BD%D0%B0\" title=\"\u0414\u0430\u0448\u043a\u043e\u0432\u0430, \u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 \u0420\u043e\u043c\u0430\u043d\u043e\u0432\u043d\u0430\">\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 \u0420\u043e\u043c\u0430\u043d\u043e\u0432\u043d\u0430 \u0414\u0430\u0448\u043a\u043e\u0432\u0430<\/a>.<\/li><\/ul><h3><span class=\"mw-headline\" id=\"XIX_.D0.B2.D0.B5.D0.BA\">XIX \u0432\u0435\u043a<\/span> <\/span><\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1952_%D0%B3%D0%BE%D0%B4\" title=\"1952 \u0433\u043e\u0434\">1852<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u0438<\/a> \u043d\u0430\u0447\u0430\u043b \u0440\u0430\u0431\u043e\u0442\u0443 \u043f\u0435\u0440\u0432\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82\" title=\"\u0423\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\">\u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442<\/a>\u2014<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%B4%D0%BD%D0%B5%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%83%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82\" title=\"\u0421\u0438\u0434\u043d\u0435\u0439\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\">\u0421\u0438\u0434\u043d\u0435\u0439\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1853_%D0%B3%D0%BE%D0%B4\" title=\"1853 \u0433\u043e\u0434\">1853<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u0442 \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B0\" title=\"\u0410\u043c\u0435\u0440\u0438\u043a\u0430\">\u0410\u043c\u0435\u0440\u0438\u043a\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BB%D0%B8%D1%80%D0%B8%D0%BD%D0%B3\" title=\"\u041a\u043b\u0438\u0440\u0438\u043d\u0433\">\u043a\u043b\u0438\u0440\u0438\u043d\u0433\u043e\u0432\u044b\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BD%D0%BA\" title=\"\u0411\u0430\u043d\u043a\">\u0431\u0430\u043d\u043a<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1875_%D0%B3%D0%BE%D0%B4\" title=\"1875 \u0433\u043e\u0434\">1875<\/a>&#160;\u2014 \u043f\u0435\u0440\u0432\u044b\u0435 \u0438\u0441\u043b\u0430\u043d\u0434\u0441\u043a\u0438\u0435 \u043f\u043e\u0441\u0435\u043b\u0435\u043d\u0446\u044b \u043f\u0440\u0438\u0431\u044b\u043b\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%BD%D0%BD%D0%B8%D0%BF%D0%B5%D0%B3\" title=\"\u0412\u0438\u043d\u043d\u0438\u043f\u0435\u0433\">\u0412\u0438\u043d\u043d\u0438\u043f\u0435\u0433<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u041a\u0430\u043d\u0430\u0434\u0430<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1881_%D0%B3%D0%BE%D0%B4\" title=\"1881 \u0433\u043e\u0434\">1881<\/a>&#160;\u2014 \u0436\u0438\u0442\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B4%D0%BC%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D1%80%D0%B0%D1%82%D0%B8%D0%B2%D0%BD%D0%BE%D0%B5_%D0%B4%D0%B5%D0%BB%D0%B5%D0%BD%D0%B8%D0%B5_%D0%A1%D0%A8%D0%90\" title=\"\u0410\u0434\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430\u0442\u0438\u0432\u043d\u043e\u0435 \u0434\u0435\u043b\u0435\u043d\u0438\u0435 \u0421\u0428\u0410\">\u0448\u0442\u0430\u0442\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D0%B0%D1%8F_%D0%94%D0%B0%D0%BA%D0%BE%D1%82%D0%B0\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u0430\u044f \u0414\u0430\u043a\u043e\u0442\u0430\">\u0421\u0435\u0432\u0435\u0440\u043d\u0430\u044f \u0414\u0430\u043a\u043e\u0442\u0430<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a>) \u0414\u044d\u0432\u0438\u0434 \u0425\u044c\u044e\u0441\u0442\u043e\u043d (<span lang=\"en\" style=\"font-style: italic\" xml:lang=\"en\">David Houston<\/span>) <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%82%D0%B5%D0%BD%D1%82\" title=\"\u041f\u0430\u0442\u0435\u043d\u0442\">\u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043b<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BE%D1%82%D0%BE%D0%BF%D0%BB%D1%91%D0%BD%D0%BA%D0%B0\" title=\"\u0424\u043e\u0442\u043e\u043f\u043b\u0451\u043d\u043a\u0430\">\u0444\u043e\u0442\u043e\u043f\u043b\u0451\u043d\u043a\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1887_%D0%B3%D0%BE%D0%B4\" title=\"1887 \u0433\u043e\u0434\">1887<\/a>&#160;\u2014 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0438\u0437\u043e\u0431\u0440\u0435\u0442\u0430\u0442\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%B4%D0%B8%D1%81%D0%BE%D0%BD,_%D0%A2%D0%BE%D0%BC%D0%B0%D1%81_%D0%90%D0%BB%D0%B2%D0%B0\" title=\"\u042d\u0434\u0438\u0441\u043e\u043d, \u0422\u043e\u043c\u0430\u0441 \u0410\u043b\u0432\u0430\">\u0422\u043e\u043c\u0430\u0441 \u042d\u0434\u0438\u0441\u043e\u043d<\/a> (<span lang=\"en\" style=\"font-style: italic\" xml:lang=\"en\">Thomas Alva Edison<\/span>) \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043b \u044d\u043b\u0435\u043a\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u0443\u044e \u043c\u0430\u0448\u0438\u043d\u0443 \u0434\u043b\u044f \u043f\u043e\u0434\u0441\u0447\u0451\u0442\u0430 \u0433\u043e\u043b\u043e\u0441\u043e\u0432 \u043d\u0430 \u0432\u044b\u0431\u043e\u0440\u0430\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1891_%D0%B3%D0%BE%D0%B4\" title=\"1891 \u0433\u043e\u0434\">1891<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%BE%D0%BA%D0%B3%D0%BE%D0%BB%D1%8C%D0%BC\" title=\"\u0421\u0442\u043e\u043a\u0433\u043e\u043b\u044c\u043c\">\u0421\u0442\u043e\u043a\u0433\u043e\u043b\u044c\u043c\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u043c\u0438\u0440\u0435 \u044d\u0442\u043d\u043e\u0433\u0440\u0430\u0444\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u043c\u0443\u0437\u0435\u0439 \u043f\u043e\u0434 \u043e\u0442\u043a\u0440\u044b\u0442\u044b\u043c \u043d\u0435\u0431\u043e\u043c \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BA%D0%B0%D0%BD%D1%81%D0%B5%D0%BD\" title=\"\u0421\u043a\u0430\u043d\u0441\u0435\u043d\">\u0421\u043a\u0430\u043d\u0441\u0435\u043d<\/a>\u00bb<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1899_%D0%B3%D0%BE%D0%B4\" title=\"1899 \u0433\u043e\u0434\">1899<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%BE-%D0%B1%D1%83%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_(1899%E2%80%941902)\" title=\"\u0410\u043d\u0433\u043b\u043e-\u0431\u0443\u0440\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (1899\u20141902)\">\u0410\u043d\u0433\u043b\u043e-\u0431\u0443\u0440\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a>.<\/li><\/ul><h3><span class=\"mw-headline\" id=\"XX_.D0.B2.D0.B5.D0.BA\">XX \u0432\u0435\u043a<\/span> <\/span><\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B8%D0%BD%D0%BE%D0%B2%D1%8C%D0%B5%D0%B2,_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D0%B8%D0%B9_%D0%95%D0%B2%D1%81%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0417\u0438\u043d\u043e\u0432\u044c\u0435\u0432, \u0413\u0440\u0438\u0433\u043e\u0440\u0438\u0439 \u0415\u0432\u0441\u0435\u0435\u0432\u0438\u0447\">\u0413. \u0417\u0438\u043d\u043e\u0432\u044c\u0435\u0432<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BC%D0%B5%D0%BD%D0%B5%D0%B2,_%D0%9B%D0%B5%D0%B2_%D0%91%D0%BE%D1%80%D0%B8%D1%81%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041a\u0430\u043c\u0435\u043d\u0435\u0432, \u041b\u0435\u0432 \u0411\u043e\u0440\u0438\u0441\u043e\u0432\u0438\u0447\">\u041b. \u041a\u0430\u043c\u0435\u043d\u0435\u0432<\/a> \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043b\u0438 \u0432 \u0433\u0430\u0437\u0435\u0442\u0435 \u00ab\u041d\u043e\u0432\u0430\u044f \u0436\u0438\u0437\u043d\u044c\u00bb \u043f\u0438\u0441\u044c\u043c\u043e \u00ab\u041a \u0442\u0435\u043a\u0443\u0449\u0435\u043c\u0443 \u043c\u043e\u043c\u0435\u043d\u0442\u0443\u00bb, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u043e\u043d\u0438 \u0432\u044b\u0441\u0442\u0443\u043f\u0430\u043b\u0438 \u043f\u0440\u043e\u0442\u0438\u0432 \u0432\u044b\u043d\u0435\u0441\u0435\u043d\u043d\u043e\u0433\u043e \u0426\u041a \u0420\u0421\u0414\u0420\u041f(\u0431) \u0440\u0435\u0448\u0435\u043d\u0438\u044f \u043e \u0432\u043e\u043e\u0440\u0443\u0436\u0451\u043d\u043d\u043e\u043c \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%B5%D0%B2%D0%B8%D0%BA%D0%B8\" title=\"\u0411\u043e\u043b\u044c\u0448\u0435\u0432\u0438\u043a\u0438\">\u0431\u043e\u043b\u044c\u0448\u0435\u0432\u0438\u043a\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 \u0440\u0430\u0434\u0438\u043e\u0443\u043f\u0440\u0430\u0432\u043b\u044f\u0435\u043c\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u044f<\/a>). \u041e\u043d \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0430\u043b\u0441\u044f \u043e\u0434\u0438\u043d \u0447\u0430\u0441, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BC%D0%BE%D0%BB%D1%91%D1%82\" title=\"\u0421\u0430\u043c\u043e\u043b\u0451\u0442\">\u0441\u0430\u043c\u043e\u043b\u0451\u0442<\/a> \u043f\u0440\u0435\u043e\u0434\u043e\u043b\u0435\u043b \u0440\u0430\u0441\u0441\u0442\u043e\u044f\u043d\u0438\u0435 100 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D0%BB%D0%BE%D0%BC%D0%B5%D1%82%D1%80\" title=\"\u041a\u0438\u043b\u043e\u043c\u0435\u0442\u0440\">\u043a\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4\" title=\"1919 \u0433\u043e\u0434\">1919<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B0%D0%B6%D0%B4%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B2_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8\" title=\"\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438\">\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438<\/a>. \u0427\u0430\u0441\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%B1%D0%BE%D1%87%D0%B5-%D0%9A%D1%80%D0%B5%D1%81%D1%82%D1%8C%D1%8F%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D0%B0%D1%8F_%D0%90%D1%80%D0%BC%D0%B8%D1%8F\" class=\"mw-redirect\" title=\"\u0420\u0430\u0431\u043e\u0447\u0435-\u041a\u0440\u0435\u0441\u0442\u044c\u044f\u043d\u0441\u043a\u0430\u044f \u041a\u0440\u0430\u0441\u043d\u0430\u044f \u0410\u0440\u043c\u0438\u044f\">\u0420\u041a\u041a\u0410<\/a> \u043d\u0430\u0447\u0430\u043b\u0438 \u043f\u0440\u043e\u0432\u0435\u0434\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D0%BB%D0%BE%D0%B2%D1%81%D0%BA%D0%BE-%D0%9A%D1%80%D0%BE%D0%BC%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F\" class=\"mw-redirect\" title=\"\u041e\u0440\u043b\u043e\u0432\u0441\u043a\u043e-\u041a\u0440\u043e\u043c\u0441\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f\">\u041e\u0440\u043b\u043e\u0432\u0441\u043a\u043e-\u041a\u0440\u043e\u043c\u0441\u043a\u043e\u0439 \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u0438<\/a>, \u043f\u0440\u0438\u0432\u0435\u0434\u0448\u0435\u0439 \u043a \u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043a\u0435 \u043d\u0430\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D0%BE%D0%B5_%D0%B4%D0%B2%D0%B8%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u0411\u0