B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0410\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043c\u0435\u0436\u043f\u043b\u0430\u043d\u0435\u0442\u043d\u0430\u044f \u0441\u0442\u0430\u043d\u0446\u0438\u044f\">\u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043c\u0435\u0436\u043f\u043b\u0430\u043d\u0435\u0442\u043d\u043e\u0439 \u0441\u0442\u0430\u043d\u0446\u0438\u0438<\/a> \u00ab\u0415-1&#160;\u2014 2\u00bb \u0432 \u0441\u0442\u043e\u0440\u043e\u043d\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%83%D0%BD%D0%B0\" title=\"\u041b\u0443\u043d\u0430\">\u041b\u0443\u043d\u044b<\/a>. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%BA%D0%B5%D1%82%D0%B0-%D0%BD%D0%BE%D1%81%D0%B8%D1%82%D0%B5%D0%BB%D1%8C\" title=\"\u0420\u0430\u043a\u0435\u0442\u0430-\u043d\u043e\u0441\u0438\u0442\u0435\u043b\u044c\">\u0420\u0430\u043a\u0435\u0442\u0430-\u043d\u043e\u0441\u0438\u0442\u0435\u043b\u044c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%92%D0%BE%D1%81%D1%82%D0%BE%D0%BA-%D0%9B_(%D1%80%D0%B0%D0%BA%D0%B5%D1%82%D0%B0-%D0%BD%D0%BE%D1%81%D0%B8%D1%82%D0%B5%D0%BB%D1%8C)&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0412\u043e\u0441\u0442\u043e\u043a-\u041b (\u0440\u0430\u043a\u0435\u0442\u0430-\u043d\u043e\u0441\u0438\u0442\u0435\u043b\u044c) (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u00ab\u0412\u043e\u0441\u0442\u043e\u043a-\u041b\u00bb<\/a> 8\u041a72 \u043f\u043e\u0442\u0435\u0440\u043f\u0435\u043b\u0430 \u0430\u0432\u0430\u0440\u0438\u044e \u0432\u0441\u043a\u043e\u0440\u0435 \u043f\u043e\u0441\u043b\u0435 \u0441\u0442\u0430\u0440\u0442\u0430 \u0438 \u0432\u0437\u043e\u0440\u0432\u0430\u043b\u0430\u0441\u044c (\u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D0%BB%D0%BE%D1%82%D0%B8%D1%80%D1%83%D0%B5%D0%BC%D1%8B%D0%B9_%D0%BA%D0