433\u043e\u0434\">1962<\/a>&#160;\u2014 \u043e\u0442\u043a\u0440\u044b\u043b\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%82%D0%BE%D1%80%D0%BE%D0%B9_%D0%92%D0%B0%D1%82%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D0%B1%D0%BE%D1%80\" title=\"\u0412\u0442\u043e\u0440\u043e\u0439 \u0412\u0430\u0442\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0441\u043e\u0431\u043e\u0440\">\u0432\u0442\u043e\u0440\u043e\u0439 \u0412\u0430\u0442\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0441\u043e\u0431\u043e\u0440<\/a>, \u043e\u0442\u043c\u0435\u043d\u0438\u0432\u0448\u0438\u0439 \u043e\u0431\u044f\u0437\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u044c \u043b\u0430\u0442\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u044f\u0437\u044b\u043a\u0430 \u043f\u0440\u0438 \u043a\u0430\u0442\u043e\u043b\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0431\u043e\u0433\u043e\u0441\u043b\u0443\u0436\u0435\u043d\u0438\u044f\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1973_%D0%B3%D0%BE%D0%B4\" title=\"1973 \u0433\u043e\u0434\">1973<\/a>&#160;\u2014 \u0440\u0430\u0437\u0432\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D1%81%D0%BB%D0%B8,_%D0%AD%D0%BB%D0%B2%D0%B8%D1%81\" title=\"\u041f\u0440\u0435\u0441\u043b\u0438, \u042d\u043b\u0432\u0438\u0441\">\u042d\u043b\u0432\u0438\u0441\u0430<\/a> (<span lang=\"en\" style=\"font-style: italic\" xml:lang=\"en\">Elvis Aaron Presley<\/span>) \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D1%81%D0%BB%D0%B8,_%D0%9F%D1%80%D0%B8%D1%81%D1%86%D0%B8%D0%BB%D0%BB%D0%B0\" title=\"\u041f\u0440\u0435\u0441\u043b\u0438, \u041f\u0440\u0438\u0441\u0446\u0438\u043b\u043b\u0430\">\u041f\u0440\u0438\u0441\u0446\u0438\u043b\u043b\u044b \u041f\u0440\u0435\u0441\u043b\u0438<\/a> (<span lang=\"en\" style=\"font-style: italic\" xml:lang=\"en\">Priscilla Presley<\/span>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1984_%D0%B3%D0%BE%D0%B4\" title=\"1984 \u0433\u043e\u0434\">1984<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%8B%D1%85%D0%BE%D0%B4_%D0%B2_%D0%BE%D1%82%D0%BA%D1%80%D1%8B%D1%82%D1%8B%D0%B9_%D0%BA%D0%BE%D1%81%D0%BC%D0%BE%D1%81\" title=\"\u0412\u044b\u0445\u043e\u0434 \u0432 \u043e\u0442\u043a\u0440\u044b\u0442\u044b\u0439 \u043a\u043e\u0441\u043c\u043e\u0441\">\u0432 \u043e\u0442\u043a\u0440\u044b\u0442\u044b\u0439 \u043a\u043e\u0441\u043c\u043e\u0441 \u0432\u044b\u0448\u043b\u0430<\/a> \u043f\u0435\u0440\u0432\u0430\u044f \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0436\u0435\u043d\u0449\u0438\u043d\u0430-<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%81%D0%BC%D0%BE%D0%BD%D0%B0%D0%B2%D1%82\" title=\"\u041a\u043e\u0441\u043c\u043e\u043d\u0430\u0432\u0442\">\u0430\u0441\u0442\u0440\u043e\u043d\u0430\u0432\u0442<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BB%D0%BB%D0%B8%D0%B2%D1%8D%D0%BD,_%D0%9A%D1%8D%D1%82%D1%80%D0%B8%D0%BD_%D0%94%D1%83%D0%B0%D0%B9%D0%B5%D1%80\" class=\"mw-redirect\" title=\"\u0421\u0430\u043b\u043b\u0438\u0432\u044d\u043d, \u041a\u044d\u0442\u0440\u0438\u043d \u0414\u0443\u0430\u0439\u0435\u0440\">\u041a\u044d\u0442\u0440\u0438\u043d \u0421\u0430\u043b\u043b\u0438\u0432\u044d\u043d<\/a> (<span lang=\"en\" style=\"font-style: italic\" xml:lang=\"en\">Kathryn Dwyer \u00abKathy\u00bb Sullivan<\/span>) (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D0%BB%D0%BE%D1%82%D0%B8%D1%80%D1%83%D0%B5%D0%BC%D1%8B%D0%B9_%D0%BA%D0%BE%D1%81%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%BE%D0%BB%D1%91%D1%82\" title=\"\u041f\u0438\u043b\u043e\u0442\u0438\u0440\u0443\u0435\u043c\u044b\u0439 \u043a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u043f\u043e\u043b\u0451\u0442\">\u043f\u043e\u043b\u0451\u0442<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D0%BB%D0%BB%D0%B5%D0%BD%D0%B4%D0%B6%D0%B5%D1%80_STS-41G\" class=\"mw-redirect\" title=\"\u0427\u0435\u043b\u043b\u0435\u043d\u0434\u0436\u0435\u0440 STS-41G\">STS-41G<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D0%BB%D0%BE%D1%82%D0%B8%D1%80%D1%83%D0%B5%D0%BC%D1%8B%D0%B9_%D0%BA%D0%BE%D1%81%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D0%BE%D1%80%D0%B0%D0%B1%D0%BB%D1%8C\" title=\"\u041f\u0438\u043b\u043e\u0442\u0438\u0440\u0443\u0435\u043c\u044b\u0439 \u043a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u043a\u043e\u0440\u0430\u0431\u043b\u044c\">\u043a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u043c \u043a\u043e\u0440\u0430\u0431\u043b\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D0%BB%D0%BB%D0%B5%D0%BD%D0%B4%D0%B6%D0%B5%D1%80_(%D1%88%D0%B0%D1%82%D1%82%D0%BB)\" title=\"\u0427\u0435\u043b\u043b\u0435\u043d\u0434\u0436\u0435\u0440 (\u0448\u0430\u0442\u0442\u043b)\">\u00ab\u0427\u0435\u043b\u043b\u0435\u043d\u0434\u0436\u0435\u0440\u00bb<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%A2%D1%83-154_%D0%B2_%D0%9E%D0%BC%D1%81%D0%BA%D0%B5\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0422\u0443-154 \u0432 \u041e\u043c\u0441\u043a\u0435\">\u043a\u0440\u0443\u043f\u043d\u0430\u044f \u0430\u0432\u0438\u0430\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0432 \u0430\u044d\u0440\u043e\u043f\u043e\u0440\u0442\u0443 \u041e\u043c\u0441\u043a\u0430<\/a>, \u0421\u0421\u0421\u0420: \u0441\u0430\u043c\u043e\u043b\u0451\u0442 \u0422\u0443-154 \u043f\u0440\u0438 \u043f\u043e\u0441\u0430\u0434\u043a\u0435 \u0441\u0442\u043e\u043b\u043a\u043d\u0443\u043b\u0441\u044f \u0441 \u0434\u0432\u0443\u043c\u044f \u043c\u0430\u0448\u0438\u043d\u0430\u043c\u0438 \u0430\u044d\u0440\u043e\u0434\u0440\u043e\u043c\u043d\u044b\u0445 \u0441\u043b\u0443\u0436\u0431.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1990_%D0%B3%D0%BE%D0%B4\" title=\"1990 \u0433\u043e\u0434\">1990<\/a>&#160;\u2014 \u0441\u0435\u0440\u0431\u0441\u043a\u0438\u0439 \u0431\u0438\u0437\u043d\u0435\u0441\u043c\u0435\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%B6%D0%BD%D0%B0%D1%82%D0%BE%D0%B2%D0%B8%D1%87,_%D0%96%D0%B5%D0%BB%D1%8C%D0%BA%D0%BE\" title=\"\u0420\u0430\u0436\u043d\u0430\u0442\u043e\u0432\u0438\u0447, \u0416\u0435\u043b\u044c\u043a\u043e\">\u0416\u0435\u043b\u044c\u043a\u043e \u0420\u0430\u0436\u043d\u0430\u0442\u043e\u0432\u0438\u0447 \u00ab\u0410\u0440\u043a\u0430\u043d\u00bb<\/a> (<span lang=\"sr\" style=\"font-style: italic\" xml:lang=\"sr\">\u0416\u0435\u0459\u043a\u043e \u0420\u0430\u0436\u043d\u0430\u0442\u043e\u0432\u0438\u045b \u00ab\u0410\u0440\u043a\u0430\u043d\u00bb<\/span>) \u0438 19 \u0444\u0443\u0442\u0431\u043e\u043b\u044c\u043d\u044b\u0445 \u0444\u0430\u043d\u0430\u0442\u043e\u0432 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D0%B3%D1%80%D0%B0%D0%B4\" title=\"\u0411\u0435\u043b\u0433\u0440\u0430\u0434\">\u0411\u0435\u043b\u0433\u0440\u0430\u0434\u0430<\/a> \u0441\u043e\u0437\u0434\u0430\u044e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D1%80%D0%B1%D1%81%D0%BA%D0%B0%D1%8F_%D0%B4%D0%BE%D0%B1%D1%80%D0%BE%D0%B2%D0%BE%D0%BB%D1%8C%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%B3%D0%B2%D0%B0%D1%80%D0%B4%D0%B8%D1%8F\" title=\"\u0421\u0435\u0440\u0431\u0441\u043a\u0430\u044f \u0434\u043e\u0431\u0440\u043e\u0432\u043e\u043b\u044c\u0447\u0435\u0441\u043a\u0430\u044f \u0433\u0432\u0430\u0440\u0434\u0438\u044f\">\u0421\u0435\u0440\u0431\u0441\u043a\u0443\u044e \u0434\u043e\u0431\u0440\u043e\u0432\u043e\u043b\u044c\u0447\u0435\u0441\u043a\u0443\u044e \u0433\u0432\u0430\u0440\u0434\u0438\u044e<\/a>. \u041c\u0435\u043d\u0435\u0435 \u0447\u0435\u043c \u0447\u0435\u0440\u0435\u0437 \u0433\u043e\u0434 \u043e\u043d\u0430 \u043d\u0430\u0447\u043d\u0451\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B2_%D0%A5%D0%BE%D1%80%D0%B2%D0%B0%D1%82%D0%B8%D0%B8\" title=\"\u0412\u043e\u0439\u043d\u0430 \u0432 \u0425\u043e\u0440\u0432\u0430\u0442\u0438\u0438\">\u0432\u043e\u0435\u0432\u0430\u0442\u044c \u0432 \u0425\u043e\u0440\u0432\u0430\u0442\u0438\u0438<\/a>, \u0430 \u043f\u043e\u0442\u043e\u043c \u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D1%81%D0%BD%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0411\u043e\u0441\u043d\u0438\u0439\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0411\u043e\u0441\u043d\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1994_%D0%B3%D0%BE%D0%B4\" title=\"1994 \u0433\u043e\u0434\">1994<\/a>&#160;\u2014 \u043e\u0431\u0432\u0430\u043b\u044c\u043d\u043e\u0435 \u043f\u0430\u0434\u0435\u043d\u0438\u0435 \u043a\u0443\u0440\u0441\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D0%B1%D0%BB%D1%8C\" title=\"\u0420\u0443\u0431\u043b\u044c\">\u0440\u0443\u0431\u043b\u044f<\/a> \u043f\u043e \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044e \u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D0%BB%D0%BB%D0%B0%D1%80_%D0%A1%D0%A8%D0%90\" title=\"\u0414\u043e\u043b\u043b\u0430\u0440 \u0421\u0428\u0410\">\u0434\u043e\u043b\u043b\u0430\u0440\u0443<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D1%91%D1%80%D0%BD%D1%8B%D0%B9_%D0%B2%D1%82%D0%BE%D1%80%D0%BD%D0%B8%D0%BA_(1994)\" title=\"\u0427\u0451\u0440\u043d\u044b\u0439 \u0432\u0442\u043e\u0440\u043d\u0438\u043a (1994)\">\u00ab\u0447\u0451\u0440\u043d\u044b\u0439 \u0432\u0442\u043e\u0440\u043d\u0438\u043a\u00bb<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1999_%D0%B3%D0%BE%D0%B4\" title=\"1999 \u0433\u043e\u0434\">1999<\/a><ul><li>\u041a\u0430\u043a \u0437\u0430\u044f\u0432\u0438\u043b \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%81%D1%82%D1%80%D0%BE%D0%BD%D0%BE%D0%BC\" title=\"\u0410\u0441\u0442\u0440\u043e\u043d\u043e\u043c\">\u0430\u0441\u0442\u0440\u043e\u043d\u043e\u043c<\/a> \u0414\u0436\u043e\u043d \u041c\u044e\u0440\u0440\u0435\u0439 (<span lang=\"en\" style=\"font-style: italic\" xml:lang=\"en\">John Murray<\/span>), \u0438\u0441\u0445\u043e\u0434\u044f \u0438\u0437 \u0435\u0433\u043e \u0440\u0430\u0441\u0447\u0451\u0442\u043e\u0432, \u0432\u043e\u043a\u0440\u0443\u0433 \u0421\u043e\u043b\u043d\u0446\u0430 \u043f\u043e \u0434\u0435\u0441\u044f\u0442\u043e\u0439 \u043e\u0440\u0431\u0438\u0442\u0435 \u0434\u0432\u0438\u0436\u0435\u0442\u0441\u044f \u043e\u0433\u0440\u043e\u043c\u043d\u0430\u044f \u043f\u043b\u0430\u043d\u0435\u0442\u0430, \u043f\u043e \u0440\u0430\u0437\u043c\u0435\u0440\u0430\u043c \u0431\u043e\u043b\u044c\u0448\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%BF%D0%B8%D1%82%D0%B5%D1%80_(%D0%BF%D0%BB%D0%B0%D0%BD%D0%B5%D1%82%D0%B0)\" class=\"mw-redirect\" title=\"\u042e\u043f\u0438\u0442\u0435\u0440 (\u043f\u043b\u0430\u043d\u0435\u0442\u0430)\">\u042e\u043f\u0438\u0442\u0435\u0440\u0430<\/a>.<\/li><li>\u0412\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a> \u0438\u0437\u0431\u0440\u0430\u043d\u0430 \u043d\u043e\u0432\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%B8%D0%B0%D0%BD%D0%BD%D0%B0_(%D1%81%D0%B8%D0%BC%D0%B2%D0%BE%D0%BB)\" title=\"\u041c\u0430\u0440\u0438\u0430\u043d\u043d\u0430 (\u0441\u0438\u043c\u0432\u043e\u043b)\">\u041c\u0430\u0440\u0438\u0430\u043d\u043d\u0430<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%B5%D0%BD%D1%89%D0%B8%D0%BD%D0%B0\" title=\"\u0416\u0435\u043d\u0449\u0438\u043d\u0430\">\u0436\u0435\u043d\u0449\u0438\u043d\u0430<\/a>, \u0447\u0435\u0439 \u043e\u0431\u043b\u0438\u043a \u0434\u043e\u043b\u0436\u0435\u043d \u0431\u0443\u0434\u0435\u0442 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u0442\u044c \u0441\u0438\u043c\u0432\u043e\u043b \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438. \u0415\u044e \u0441\u0442\u0430\u043b\u0430 \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u0430\u044f \u0442\u043e\u043f-\u043c\u043e\u0434\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%81%D1%82%D0%B0,_%D0%9B%D0%B5%D1%82%D0%B8%D1%86%D0%B8%D1%8F\" title=\"\u041a\u0430\u0441\u0442\u0430, \u041b\u0435\u0442\u0438\u0446\u0438\u044f\">\u041b\u0435\u0442\u0438\u0446\u0438\u044f \u041a\u0430\u0441\u0442\u0430<\/a> (<span lang=\"en\" style=\"font-style: italic\" xml:lang=\"en\">Laetitia Maria Laure Casta<\/span>), \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u0431\u044b\u043b\u0430 \u043e\u0442\u043e\u0431\u0440\u0430\u043d\u0430 \u0441\u0440\u0435\u0434\u0438 \u043f\u0440\u043e\u0447\u0438\u0445 \u043f\u0440\u0435\u0442\u0435\u043d\u0434\u0435\u043d\u0442\u043e\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%8D%D1%80\" title=\"\u041c\u044d\u0440\">\u043c\u044d\u0440\u0430\u043c\u0438<\/a> \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%80%D0%BE%D0%B4\" title=\"\u0413\u043e\u0440\u043e\u0434\">\u0433\u043e\u0440\u043e\u0434\u043e\u0432<\/a>.<\/li><\/ul><\/li><\/ul>"}